import facebook from './assets/facebook.png';
import logo from './assets/back.jpg';
import telegram from './assets/telegram.png';


function Contents() {
    return (
        <div className="main">
            <div className="img">
                <img src={user} alt="Caseay Profile" />
            </div>
            <div className="data">
                <h2>HI, <span>Caseay_Off!</span></h2>
                <p>Caseay a <span>Software Engineering</span> Student at</p>
                <p></p>
            </div>
        </div>
    );
}

